$(document).ready(function(){let e;$.ajax({url:"config.json",type:"GET",dataType:"json",success:function(n){serverURL=n.SERVER_URL,serverPort=n.SERVER_PORT,e=`${n.SERVER_URL}:${n.SERVER_PORT}`},error:function(){console.log("cannot find config.json file, cannot run application")}}),$("#register").submit(function(){event.preventDefault(),console.log("button clicked");const n=$("#username").val(),o=$("#password").val(),l=$("#fullName").val(),a=$("#email").val();0===n.length?console.log("please enter a username"):0===a.length?console.log("please enter a email"):$.ajax({url:`${e}/users`,type:"POST",data:{username:n,password:o,fullName:l,email:a},success:function(e){console.log("post"),console.log(e);$("#username").val(""),$("#password").val(""),$("#fullName").val(""),$("#email").val("")},error:function(e){console.log(e),console.log("Something went wrong with registering a new user")}})})});